import "./App.css";
import SongAdd from "./components/songs/SongAdd";
import SongList from "./components/songs/SongList";
import UserList from "./components/user/UserList";

function App() {
  return <div className="App">
    <UserList />
    <div className="ui divider"></div>
    <SongAdd />
    <div className="ui divider"></div>
    <SongList />
  </div>;
}

export default App;
